import React, { useState } from 'react';
import { User, List, Settings, LogOut } from 'lucide-react';

const ProfileNavbar = () => {
  const [activeTab, setActiveTab] = useState('profile');
  
  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };
  
  return (
    <div className="w-full bg-gray-800 text-white">
      <div className="container mx-auto px-4">
        <div className="flex items-center justify-between">
          <div className="text-xl font-bold py-4">MyApp</div>
          
          <nav className="flex">
            <button 
              className={`flex items-center px-4 py-3 border-b-2 ${activeTab === 'profile' ? 'border-blue-500 text-blue-300' : 'border-transparent hover:text-gray-300'}`}
              onClick={() => handleTabClick('profile')}
            >
              <User className="mr-2 h-5 w-5" />
              <span>Profile</span>
            </button>
            
            <button 
              className={`flex items-center px-4 py-3 border-b-2 ${activeTab === 'userList' ? 'border-blue-500 text-blue-300' : 'border-transparent hover:text-gray-300'}`}
              onClick={() => handleTabClick('userList')}
            >
              <List className="mr-2 h-5 w-5" />
              <span>User List</span>
            </button>
            
            <button 
              className={`flex items-center px-4 py-3 border-b-2 ${activeTab === 'selfProfile' ? 'border-blue-500 text-blue-300' : 'border-transparent hover:text-gray-300'}`}
              onClick={() => handleTabClick('selfProfile')}
            >
              <Settings className="mr-2 h-5 w-5" />
              <span>Self Profile</span>
            </button>
            
            <button 
              className="flex items-center px-4 py-3 text-red-400 hover:text-red-300 ml-2"
              onClick={() => console.log('Logging out...')}
            >
              <LogOut className="mr-2 h-5 w-5" />
              <span>Logout</span>
            </button>
          </nav>
        </div>
      </div>
    </div>
  );
};

export default ProfileNavbar;
